const Notes = () => {

return(
    <>
    
    
    <div className="container">

      <h1 className="bg-danger text-white m-5 head">Uploaded Files</h1>

        <div className="row">
                
        <h1 id="notes">Subject Notes</h1>
          
          </div>
        </div>
      
    
    </>
);
};
export default Notes;
